import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Store from './Store'
import store from './Store';
import {Provider } from 'react-redux'

store.subscribe(()=>console.log(store.getState() ) )

const Element = document.getElementById('root');
ReactDOM.render(
  <React.StrictMode>
  <Provider></Provider>
    <App />
  </React.StrictMode>,
  Element
);
